input_str = """"""

def possible_reaction(s, t):
    CAPS  = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
    SMALL = "abcdefghijklmnopqrstuvwxyz"
    ## s, t: one character each of the same letter
    ## returns true if s is capital and t is not, and vice versa
    return ((s in CAPS) and (t in SMALL)) or ((s in SMALL) and (t in CAPS))

def Main(input_str):
    i = 0
    j = 1
    while i < len(input_str) - 1:
        while j < len(input_str):
            s = input_str[i]
            t = input_str[j]
            if s.lower() == t.lower():
                if not possible_reaction(s, t):
                    continue
                else:
                    #delete those two letters from input_str!
                    pass
